import { Backdrop, CircularProgress } from '@mui/material';
import React, { useState } from 'react';
import HighchartStockComp from '../highchart/highchatStockComp';
import PerRiverComp from './PerRiverComp';
import { PerRiverInit } from './PER_River_Explain';

function Tess() {
    const [loading, setLoading] = useState(false);

    const options = {
        xAxis: {
            type : "datetime",
            labels : {
                format : '{value:%Y-%m}'
            }
        },
        chart : {
            height : 600
        },
        accessibility: {
            enabled : false
        },
        series: [
            {
                name : 'Kline',
                data : [],
            }
        ],
        stockTools : {
            gui : {
                buttons: ["indicators", "fullScreen"]
            }
        }
    }

    return (
        <>
            <div className = 'row mx-auto py-3' style = {{ width : "90%"}}>
                <div className = 'col-md-8 mx-auto'>
                    <PerRiverComp
                        pricingName = "本益比河流圖"
                        options = { options }
                        pricingExplain = { PerRiverInit }
                    />
                </div>
            </div>
        </>
    );
}

export default Tess;
